import React, { Component } from "react";
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import "./header.css";

export class Header extends Component {
  render(){
    console.log(this.props.userObj.admin)
    return (
      <div className="header">
        <div>
          <img src="https://placeholder.com/wp-content/uploads/2018/10/placeholder.com-logo3.jpg" alt="logo"  />
          <ol>
            <li><Link to='/'>Home</Link></li>
            <li><Link to='/blogs'>Blogs</Link></li>
            <li><Link to='/about'>About</Link></li>
            <li><Link to='/contact'>Contact</Link></li>
            <li><Link to='/stripe'>Donate</Link></li>
            { this.props.userObj.admin == true ?  
              <li><Link to='/dashboard/clients'>Admin</Link></li> 
            : null
            }
            { this.props.userObj.user.length == 0 ? <li><Link to='/register'>Register</Link></li> : null}

          </ol>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    userObj: state
  }
};

export default connect(mapStateToProps)(Header);
